import React from 'react';

function Footer() {
    return (
        <footer className="footer">
            <p>Walpapur Studio. Beta 0.3</p>
            <p>Development plan</p>
            <ol>
                <li>Beta 0.3 - 16.04</li>
                <li>Beta 0.4 - 30.04</li>
                <li>Beta 0.5 - 20.05</li>
            </ol>
        </footer>
    );
}

export default Footer;
